	private static void convertFilesIntoLatLngCoordinates(String dirPath, int idxGeo){
		File[] files = new File(dirPath).listFiles();
		for(File f : files){
			if(f.isDirectory())continue;
			if(!f.getName().endsWith(".csv"))continue;
			U.log("File name :"+f.getName());
			U.log("path :"+f.getPath());
			convertIntoLatLngCoordinates(f.getPath(), idxGeo);
		}
	}
	
	static int row = 0;
	private static void convertIntoLatLngCoordinates(String filePath, int idxGeo){
		List<String[]> readLines = FileUtil.readCsvFile(filePath);
		
		int i = 0;
		for(String lines[] : readLines) {
			row++;
			if(i++ == 0)continue;

			if(lines.length > 19){
				System.err.println("Found extra cols, total are  :"+lines.length);
				break;
			}
	//		U.log(i);
//			U.log(lines[0]+""+lines[10]);
//			String geo = convertXYToLatLng(lines[idxGeo]);
			String geo = convertXYToLatLngCollection(lines[idxGeo]);
//			U.log(geo);
			lines[idxGeo] = geo;
//			break;
		}
		
		FileUtil.writeCsvFile(readLines, filePath.replace(".csv", "_Convert.csv"));
	}
	private static String convertXYToLatLngCollection(String geo){
		String vals[] = geo.split("\\]\\],\\[\\[");
//		U.log(vals.length);
		StringBuilder sb = new StringBuilder();
		for(String val : vals){
//			U.log(convertXYToLatLng(val));
			sb.append(convertXYToLatLng(val)).append(",");
		}
		return sb.toString().replaceAll(",$", "");
	}
	
	
